import logo from './logo.svg';
import './App.css';
import { Routes, Route, Link } from "react-router-dom";
import Level1 from './Level1';

function App() {
    return (
        <Routes>
            <Route path="/" element={<Level1 />} />
        </Routes>
    );
}

export default App;
